import { useEffect } from 'react';

function Clock() {
    const currentSecond = 
    useEffect(() => {
        const current = new Date();
        const currentSecond = current.getSeconds();
        return currentSecond;
    })

    return (
        <p>{currentSecond}</p>
    );
}


export default Clock;
